class MinHeap {
  constructor() {
    this.heap = [];
  }
  insert(val) {
    this.heap.push(val);
    this._bubbleUp();
  }
  extractMin() {
    const min = this.heap[0];
    const end = this.heap.pop();
    if (this.heap.length) {
      this.heap[0] = end;
      this._sinkDown();
    }
    return min;
  }
  _bubbleUp() {
    let idx = this.heap.length - 1;
    const el = this.heap[idx];
    while (idx > 0) {
      let parentIdx = Math.floor((idx - 1) / 2);
      let parent = this.heap[parentIdx];
      if (el >= parent) break;
      this.heap[parentIdx] = el;
      this.heap[idx] = parent;
      idx = parentIdx;
    }
  }
  _sinkDown() {
    let idx = 0;
    const length = this.heap.length;
    const el = this.heap[0];
    while (true) {
      let left = 2 * idx + 1, right = 2 * idx + 2;
      let swap = null;
      if (left < length && this.heap[left] < el) swap = left;
      if (right < length && this.heap[right] < (swap === null ? el : this.heap[left])) swap = right;
      if (swap === null) break;
      this.heap[idx] = this.heap[swap];
      this.heap[swap] = el;
      idx = swap;
    }
  }
}

